def read_file_to_array(file_name)
  file_contents = []
  File.open(file_name, 'r') do |file|
    file.each_line do |line|
      file_contents << line
    end
  end
  file_contents
end

def write_array_to_file(file_name, array)
  File.open(file_name, 'w') do |file|
    array.each do |element|
      file.puts(element)
    end
  end
end

